// import $ from "jquery";

function clickTesteo(estado) {

	console.log( `clicktesteo` );

	var cars = [
		{ type: "Lion" },
		{ type: "Rabbit" },
		{ type: "Wolf" }
	];
	// var cars = {
	// 	type: "leon"
	// }
	console.log( typeof cars );
	console.log( cars );
	estado( Array.isArray(cars) )
	
	
};

export { clickTesteo }
